size_t partition(vector<int>& s, size_t lo, size_t hi) {
    int pivot = s[(lo + hi) / 2];

    size_t i = lo - 1;
    size_t j = hi + 1;

    while (true) {
        do {
            i++;
        } while (s[i] < pivot);

        do {
            j--;
        } while (s[j] > pivot);

        if (i >= j) {
            return j;
        }

        int t = s[i];
        s[i] = s[j];
        s[j] = t;
    }
}

/**
 * @brief quickSort
 * @param s
 * @param lo
 * @param hi
 *
 * Pro: less space
 * Con: Doesn't keep the original order of duplicate items
 */
void quickSort(vector<int>& s, size_t lo, size_t hi) {
    if (lo >= hi) {
        return;
    }

    size_t p = partition(s, lo, hi);
    quickSort(s, lo, p);
    quickSort(s, p + 1, hi);
}

