void printKMax(int arr[], int n, int k) {
    if (n < k) {
        return;
    }

    deque<int> d(arr, arr + k - 1);
    int max;
    for (int i = k - 1; i < n; ++i) {
        max = 0;
        d.push_back(arr[i]);
        for (auto j = d.cbegin(); j != d.cend(); ++j) {
            if (max < *j) {
                max = *j;
            }
        }
        cout << max << ' ';
        d.pop_front();
    }
    cout << endl;
}

void printKMax2(int arr[], int n, int k) {
    // works if no dup
    if (n < k) {
        return;
    }

    set<int> s(arr, arr + k - 1);
    cout << s.size() << endl;
    for (int i = k - 1; i < n; ++i) {
        s.insert(arr[i]);
        cout << *(s.crbegin()) << ' ';
        s.erase(arr[i - k + 1]);
    }
    cout << endl;
}

void printKMax3(int arr[], int n, int k) {
    if (n < k) {
        return;
    }

    deque<int> d(arr, arr + k - 1);
    int iMax = 0;
    int max = 0;
    for (int i = k - 1; i < n; ++i) {
        d.push_back(arr[i]);

        if (iMax > (i - k + 1)) {
            if (max < arr[i]) {
                max = arr[i];
            }
        } else {
            max = 0;
            iMax = 0;
            int iDeq = 0;
            for (auto j = d.cbegin(); j != d.cend(); ++j) {
                if (max < *j) {
                    max = *j;
                    iMax = i - k + 1 + iDeq;
                }
                iDeq++;
            }
        }

        cout << max << ' ';
        d.pop_front();
    }
    cout << endl;
}

