void printKMax4(int arr[], int n, int k) {
    deque<int> d(k);
//    printQueue(d);
    int i;
    for (i = 0; i < k; ++i) {
        while ((!d.empty() && arr[i] >= arr[d.back()]))
            d.pop_back();
        d.push_back(i);
//        printQueue(d);
    }
    for (; i < n; ++i) {
        cout << arr[d.front()] << " ";
        while ((!d.empty()) && d.front() <= i - k)
            d.pop_front();
        while ((!d.empty()) && arr[i] >= arr[d.back()])
            d.pop_back();
        d.push_back(i);
    }
    cout << arr[d.front()] << endl;
}

